import React from 'react';



const Fetchpokemon = ({data}) => {
    console.log(data.url.length)
    var pokemonid = [];
    data.url.forEach((url)=>{
    	fetch(url)
    	.then(resp => resp.json())
    	.then(info=>console.log(info))

    })


    return 1;
}



export default Fetchpokemon;
